import pandas as pd

def calculate_indicators(df):
    # Define selected indicators
    indicators = ['mean', 'median', 'std']
    # Calculate and return indicators
    result = {}
    for indicator in indicators:
        if indicator == 'mean':
            result[indicator] = df.mean().mean()
        elif indicator == 'median':
            result[indicator] = df.median().median()
        elif indicator == 'std':
            result[indicator] = df.std().std()
    return result

# Example usage
if __name__ == '__main__':
    data = pd.DataFrame({'A': [1, 2, 3], 'B': [4, 5, 6]})
    print(calculate_indicators(data))
